// src/components/CardFour.js
import React from 'react';

function CardFour() {
  return (
    <div className="flex flex-col h-full">
      <h2 className="text-xl font-bold mb-4">Add Team Members</h2>
      <label>Team Member Name</label>
      <input type="text" className="mb-4 p-2 border rounded" placeholder="Enter team member name" />

      <label>Role</label>
      <input type="text" className="mb-4 p-2 border rounded" placeholder="Enter role" />

      <label>Email</label>
      <input type="email" className="mb-4 p-2 border rounded" placeholder="Enter email" />

      <label>Phone Number</label>
      <input type="tel" className="p-2 border rounded" placeholder="Enter phone number" />
    </div>
  );
}

export default CardFour;
